import React from 'react';

import classes from './Portfolio.css';
import PortfolioItem from './PortfolioItem/PortfolioItem';

const portfolio = () => (
    <div className={classes.Portfolio}>
        <h1>My works</h1>
        <PortfolioItem />
    </div>
);

export default portfolio;
